import React, { useState } from "react";
import portada from "../Titulo/Portada.jpeg";
import "../Titulo/Titulo.css";

export default function Titulo() {
    const [cartVisible, setCartVisible] = useState(false);
    const [carrito, setCarrito] = useState([
        {
            producto: {
                nombre: "Carne de Res",
                stock: 10,
                precioUnitario: 15000,
                imagen: res
            },
            cantidad: 1
        }
    ]);

    const updateQuantity = (index, cantidad) => {
        const updated = [...carrito];
        updated[index].cantidad = cantidad;
        setCarrito(updated);
    };

    const removeItem = (index) => {
        const updated = [...carrito];
        updated.splice(index, 1);
        setCarrito(updated);
    };

    const checkout = () => {
        alert("Realizando checkout...");
        setCarrito([]);
        setCartVisible(false);
    };

    return (
        <>
            <section className="hero is-fullheight-with-navbar">
                <div className="hero-head">
                    <nav className="navbar is-transparent">
                        <div className="container">
                            <div className="navbar-brand">
                                <span className="navbar-burger" data-target="navbarMenuHeroB">
                                    <span></span>
                                    <span></span>
                                    <span></span>
                                </span>
                            </div>
                            <div id="navbarMenuHeroB" className="navbar-menu">
                                <div className="navbar-end">
                                    <a className="navbar-item">Inicio</a>
                                    <a className="navbar-item">Puntos de Venta</a>
                                    <a className="navbar-item">Recetas</a>
                                    <a className="navbar-item">Sobre Nosotros</a>
                                    <span className="navbar-item">
                                        <a className="button is-text">
                                            <span className="icon">
                                                <i className="fas fa-user"></i>
                                            </span>
                                            <span>Registrate</span>
                                        </a>
                                    </span>
                                </div>
                            </div>
                        </div>
                    </nav>
                </div>

                <div className="hero-body">
                    <div className="container has-text-centered">
                        <h1 className="title has-text-white is-size-1 has-text-weight-bold has-text-shadow">
                            Carnicería
                        </h1>
                        <h2 className="subtitle has-text-white is-size-3 has-text-shadow">
                            Calidad y Buen Precio
                        </h2>
                    </div>
                </div>

                <div className="hero-foot">
                    <nav className="tabs is-boxed is-fullwidth">
                        <div className="container">
                            <ul>
                                <li><a>Res</a></li>
                                <li><a>Cerdo</a></li>
                                <li><a>Pollo</a></li>
                                <li><a>Pescado</a></li>
                            </ul>
                        </div>
                    </nav>
                </div>
            </section>
        </>
    );
}
